import React, { Component } from "react";
// import ListNews from "./ListNews";
import { CardDeck } from "reactstrap";
import ListSearchedNews from "./ListSearchedNews";
import { css } from "@emotion/core";
import PuffLoader from "react-spinners/PuffLoader";

const override = css`
  display: block;
  margin: 0 auto;
  border-color: red;
`;

const SearchedNews = ({ news, mode = "search" }) => {
  console.log(news);
  if (news) {
    for (index = 0; index <= news.lenght; index++) {
      return (
        <CardDeck
          style={{ marginLeft: "60px", display: "flex", flexWrap: "wrap" }}>
          {news.map((news) => (
            <ListSearchedNews key={news.name} snews={news} mode={mode} />
          ))}
        </CardDeck>
      );
    }
  } else {
    return (
      <div className='sweet-loading'>
        <PuffLoader
          css={override}
          size={150}
          color={"#123abc"}
          loading={true}
        />
      </div>
    );
  }
};
export default SearchedNews;
